css:
.element.style { 
background: #ff0023;
color: #ffffff;
text-decoration: none;
}
.products-carousel .products-carousel__item {
    background: #fff;
}
.collection-shelf {
    background: #e8e8e8;
}

.pb-lg-4, .py-lg-4 {
    padding-bottom: 1.5rem;
    background: #e8e8e8;
}

.products-carousel {
    background: #e8e8e8;
    margin: var(--spacer-4) auto;
    max-width: var(--content-max-width);
    min-height: 6rem;
    padding: 0 var(--spacer-2);
}

.products-carousel__title span {
    background: #e8e8e8;
    color: inherit;
    display: inline-block;
    padding-left: var(--spacer-3);
    padding-right: var(--spacer-3);
    position: relative;
}
